var t_start = 0;
function update( event ) {
	if (t_start == 0) {
		t_start = event.time*0.001;
	}

	var t = event.time*0.001-t_start;

	group.rotation.y = 1.57*Math.sin(t);
	gear1.rotation.z = -1.57*Math.sin(t);
}
